import './VideoItem.css'
import React from 'react';

const VideoItem = ({ video, onVideoSelect }) => {
  if (video.area_type === "school"){
  return (
    <div onClick={() => onVideoSelect(video)} className="video-item item">
        <div className="content" key={video.geo_id}>
          <div className="header">
            <h1>{video.city}</h1>
            <h3>Area Type: {video.area_type}</h3>
          </div>
          <div>Address: {video.line}</div>
          <div>Postal Code: {video.postal_code}</div>
          <div>score: {video._score}</div>
      </div>

    </div>
  );
}
else if (video.area_type === "city"){
  return (
    <div onClick={() => onVideoSelect(video)} className="video-item item">
        <div className="content" key={video.geo_id}>
          <div className="header">
            <h1>{video.city}</h1>
            <h3>Area Type: {video.area_type}</h3>
          </div>
          <div>Postal Code: {video.postal_code}</div>
          <div>score: {video._score}</div>
      </div>

    </div>
  );
}
else if (video.area_type === "neighborhood"){
  return (
    <div onClick={() => onVideoSelect(video)} className="video-item item">
        <div className="content" key={video.geo_id}>
          <div className="header">
            <h1>{video.city}</h1>
            <h3>Area Type: {video.area_type}</h3>
          </div>
          <div>Postal Code: {video.postal_code}</div>
          <div>State: {video.state}</div>
          <div>score: {video._score}</div>
      </div>

    </div>
  );
}
return<div></div>;
};

export default VideoItem;
